import React from "react";
import { Link } from "react-router-dom";
import { RiUserAddFill } from "react-icons/ri";
import { IoLogIn } from "react-icons/io5";
import { BsCart4 } from "react-icons/bs";
import { ImBooks } from "react-icons/im";
import { MdFavorite } from "react-icons/md";

export const Header = () => {
  return (
    <header className="w-full fixed shadow-md items-center z-50  bg-indigo-50">
      <div className=" flex justify-between items-center p-4 ">
        <Link to={"/"}>
          <div className="logo">
            <span className="text-black-200 text-2xl font-bold flex justify-start items-center">
              <ImBooks />
              BookManagementSystem
            </span>
          </div>
        </Link>
        <div className="nav-items flex">
          <span className="text-xl cursor-pointer text-grey-200 font-bold m-3  hover:text-indigo-200">
            Hello! Guest
          </span>
          <Link></Link>
          <span className="text-xl cursor-pointer text-grey-200 font-bold m-3  hover:text-indigo-200">
            <IoLogIn />
          </span>
          <span className="text-xl cursor-pointer text-grey-200 font-bold m-3  hover:text-indigo-200">
            <BsCart4 />
          </span>
          <span className="text-xl cursor-pointer text-grey-200 font-bold m-3 hover:text-indigo-200">
            <MdFavorite />
          </span>
        </div>
      </div>
    </header>
  );
};
